import { Icon, Menu } from "antd";
import styled from "styled-components";
import Link from "next/link";
const NavlinkWrapper = styled.div`
	display: flex;
	/* justify-content: center; */
	/* color: white; */
`;
const NavLinkMobile = styled.div`
	@media screen and (max-width: ${props => props.theme.tablet}) {
		padding: 0;
	}
	@media screen and (min-width: ${props => props.theme.tablet}) {
		width: 750px;
	}
	@media screen and (min-width: ${props => props.theme.desktop}) {
		width: 970px;
	}
	@media screen and (min-width: ${props => props.theme.large}) {
		width: 900px;
	}
`;
const NavLinkDesktop = styled.div`
	/* @media screen and (max-width: ${props => props.theme.tablet}) {
		padding: 0;
	}
	@media screen and (min-width: ${props => props.theme.tablet}) {
		width: 750px;
	}
	@media screen and (min-width: ${props => props.theme.desktop}) {
		width: 970px;
	}
	@media screen and (min-width: ${props => props.theme.large}) {
		width: 900px;
	} */
`;
const Navlinks = () => (
	<NavlinkWrapper>
		<NavLinkMobile>
			<Link to="/">
				<Icon type="home" />
			</Link>
			<Link to="/about-me">
				<Icon type="user" />
			</Link>
		</NavLinkMobile>
		<NavLinkDesktop>
			<Link to="/">
				<Icon type="home" />
			</Link>
			<Link to="/about-me">
				<Icon type="user" />
			</Link>
		</NavLinkDesktop>
	</NavlinkWrapper>
);
export default Navlinks;
